            <p>Ella pasa toda la mañana esculpiendo obras dentro de su cabaña. Su casa abre a partir de las 10am y cierra a las 6pm, pero durante la Primavera, el Verano, o Otoño, los jugadores primero deben de tener como mínimo dos corazones de amistad para poder ingresar. Los jugadores de cualquier nivel de amistad pueden entrar en Invierno entre las 10am y las 6pm.</p>
